import React from "react";
import "./Navbar.css";
import MobileMenu from "../MobileMenu/MobileMenu";
import { NavbarData } from "./NavbarData";

interface Navbar {
  mobile: boolean;
}

export default function Navbar({ mobile }: Navbar) {
  return (
    <div className="Navbar">
      <div className="logo-text">LUCKBRC</div>
      {NavbarData.map((item) => {
        return (
          <a className="navbar-links" href={item.path}>
            <div className={item.cName}>{item.name}</div>
          </a>
        );
      })}
    </div>
  );
}
